    color: '#fff',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
  },
  signupOption: {
    marginTop: '15px',
    textAlign: 'center',
  },
  signupLink: {
    color: '#007bff',
    textDecoration: 'none',
  },
};

export default AddTiffinCenter;
